import React from 'react';

const HomePage: React.FC = () => {
  return (
    <div className="home">
      <img src="https://res.cloudinary.com/dyl3rncv3/image/upload/v1679982347/elewa-group-website/hero-Images/dark-to-light_xrat5g.jpg" className="bg-image" alt="bg" />
      <h5>Trade, not aid</h5>
      <h1>Southern innovations addressing global problems.</h1>

    </div>
  );
};

export default HomePage;
